//SLIDESHOW
function slideshow() {
	$('.slideshow-img').slice(1).hide();
	setInterval(function(){
		$('.slideshow-img').first().fadeOut(1000)
		.next().fadeIn(1000)
		.end()
		.appendTo('.slideshow-container');
	}, 4000); // end set interval
};

//HAMBURGER NAV
function setHamburgerNav() {
	$('.hamburger-nav').hide();
	$('.cross').hide();

	$('.hamburger').click(function(){
		$('.hamburger-nav').slideToggle('slow', function(){
			$('.hamburger').hide();
			$('.cross').show();
		});  // end slideToggle
	});  // end hamburger click

	$('.cross').click(function(){
		$('.hamburger-nav').slideToggle('slow', function(){
			$('.cross').hide();
			$('.hamburger').show();
		});  // end slideToggle
	});  // end cross click
};

//CONVERT TIMESTAMP TO DATE
function convertToDate() {
	$('.comments-li').each(function(){
		var $time = $(this).attr('id');
		$time = parseInt($time);
		$time = moment.unix($time).format("MM/DD/YYYY");
		$(this).find('.time').html($time);
	});
};

//SORT COMMENTS BY TIMESTAMP
function sortComments() {
	var $commentsUl = $('ul.comments-ul');
	var $commentsLi = $commentsUl.children('li');

	$commentsLi.sort(function(a,b){
		var aTimestamp = a.getAttribute('id');
		var bTimestamp = b.getAttribute('id');
		aTimestamp = parseInt(aTimestamp);
		bTimestamp = parseInt(bTimestamp);

		if(aTimestamp > bTimestamp) {
			return 1;
		}
		if(aTimestamp < bTimestamp) {
			return -1;
		}
		return 0;
	});
	$commentsLi.detach().appendTo($commentsUl);
};

//POPULATING COMMENTS SECTION
function populateComments() {
	var source = $('#comments-template').html();
	var template = Handlebars.compile(source);

	var data = { comments_group: [
		{name:"Vito Corleone", comment:"I'm gonna make him an offer he can't refuse.", timestamp:69379200},
		{name:"Terry Benedict", comment:"Congratulations... You're a dead man!", timestamp:1007683200},
		{name:"Jessica Rabbit", comment:"I'm not bad. I'm just drawn that way.", timestamp:583113600},
		{name:"Martin Brody", comment:"You're gonna need a bigger boat.", timestamp:172281600},
		{name:"Jack Dawson", comment:"I'm the king of the world!", timestamp:882489600},
		{name:"The Terminator", comment:"Hasta la vista, baby.", timestamp:678326400},
		{name:"The Joker", comment:"Why so serious..?", timestamp:1215993600}
	]};
	$('.comments-ul').html(template(data));	
};

